import React from 'react';
import './Projetos.css';

function Projetos() {
  return (
    <>
      <h1>Projetos</h1>
      <ul>
        <li>Projeto 1: Descrição breve do projeto 1.</li>
        <li>Projeto 2: Descrição breve do projeto 2.</li>
        <li>Projeto 3: Descrição breve do projeto 3.</li>
      </ul>
    </>
  );
}

export default Projetos;
